import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    // <Navbar bg="dark" expand="lg">
    //   <Navbar.Brand href="#home">Made In Sri Lanka</Navbar.Brand>
    //   <Navbar.Toggle aria-controls="basic-navbar-nav" />
    //   <Navbar.Collapse id="basic-navbar-nav">
    //     <Form inline>
    //       <FormControl type="text" placeholder="Search" className="mr-sm-2" />
    //       <Button variant="outline-success">Search</Button>
    //     </Form>
    //     <Nav className="mr-auto">
    //       <Nav.Link href="#home"><Link to="!#">Developers</Link></Nav.Link>
    //       <Nav.Link href="#link"><Link to="/register">Register</Link></Nav.Link>
    //       <Nav.Link href="#link"><Link to="/login">Login</Link></Nav.Link>
    //       {/* <NavDropdown title="Dropdown" id="basic-nav-dropdown">
    //             <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
    //             <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
    //             <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
    //             <NavDropdown.Divider />
    //             <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
    //           </NavDropdown> */}
    //     </Nav>
    //   </Navbar.Collapse>
    // </Navbar>
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <Link className="navbar-brand" to="/"><i className="fas fa-code"></i> DevConnector</Link>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav ml-auto">
          <li className="nav-item"><Link className="nav-link" to="!#">Developers</Link></li>
          <li className="nav-item"><Link className="nav-link" to="/register">Register</Link></li>
          <li className="nav-item"><Link className="nav-link" to="/login">Login</Link></li>
        </ul>
      </div>
      
    </nav>
  );
};

export default NavBar;
